import React from 'react';
import HeroCareer from './career/HeroCareer';
import Benefits from './career/Benefits';
import Process from './career/Process';
import Jobs from './career/Jobs';


const Career = () => {
  return (
    <>
      <HeroCareer />
      <Benefits />
      <Process />
      <Jobs />
    </>
  );
};

export default Career;
